export const BasicsScreen = () => {
  const navigation = useNavigation();

  return (
    <View style={styles.container}>
      <Button
        buttonText="Device basics"
        onPress={() => navigation.navigate('Basics_1_Screen')}
        type="solid-green"
      />
    </View>
  );
};

